import logo from "./logo.svg";
import "./App.css";

function Future() {
    return (
        <div className="feature">
            <img src="" alt="" className="feature-image" />
            <h3 className="feature-title">Title</h3>
            <p className="feature-desc">
                Lorem ipsum dolor, sit amet consectetur adipisicing elit. Facere
                dolore cum vel odit itaque voluptatem reiciendis, adipisci neque
                officia totam quasi in eveniet ullam vero fuga voluptatum vitae
                quis animi?
            </p>
        </div>
    );
}

function App() {
    return (
        <div>
            <Future></Future>
            <Future></Future>
            <Future></Future>
        </div>
    );
}
function Youtube() {
    return (
        <div className="youtubeItem">
            <div className="youtube-image">
                <img
                    src="https://images.unsplash.com/photo-1677966039656-a681a0fe59b3?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1171&q=80"
                    alt=""
                />
            </div>
            <div className="youtube-footer">
                <img
                    src="https://images.unsplash.com/photo-1677966039656-a681a0fe59b3?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1171&q=80"
                    alt=""
                />
            </div>
        </div>
    );
}

export default App;
